import NavbarStyle from "./NavbarStyle";
import React from 'react'
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <header>
      <Link to="/">
        <h1>PortFolio</h1>
      </Link>
    </header>
  )
}

export default Navbar
